css:
@-moz-document domain("sr.ht") {
body,
pre,
.event,
a.btn,
a.ref,
.message-header details[open] > div,
.navbar-brand,
.navbar .navbar-text,
.nav-tabs .nav-link.active,
.nav-tabs .nav-link.active:hover,
.navbar-light .navbar-brand a,
code,
input[type="email"],
input[type="password"],
input[type="tel"],
input[type="text"],
textarea.form-control,
.ticket-list .title > a {
    color: rgb(238, 238, 238) !important;
}
.nav-tabs .nav-link {
    color: rgb(128, 128, 128) !important;
}
a,
a.btn-link,
.highlight .gh {
    color: rgb(117, 167, 242) !important;
}
.alert a {
    color: #0242f2 !important;
}
.label a {
    color: inherit !important;
}
a.btn-white {
    color: #212529 !important;
}
a.btn-default {
    color: rgb(16, 16, 16) !important;
    background: rgb(180, 180, 180) !important;
}
body {
    background-color: rgb(16, 16, 16);
}
pre,
.event,
.nav-link.active,
.message-header details[open] > div,
input[type="email"],
input[type="password"],
input[type="tel"],
input[type="text"],
textarea.form-control {
    background-color: rgb(20, 20, 20) !important;
}
.nav-link.active,
.header-tabbed .nav .nav-item:hover,
.header-extension {
    background-color: rgb(48, 48, 48) !important;
}
.label,
.header-tabbed,
.feedback,
.markdown-nav .nav-tabs {
    border-color: rgb(48, 48, 48);
}
.blob-nav .nav-tabs .nav-link.active {
    border-bottom: unset;
}
}
